import{clearMsg}from"../../../../../../core/utils/dom/messages.js";export function setActiveTab({evt:e,tabs:t,msgElement:s}){clearMsg({container:s});const n=e.target;for(const s in t)if(e.target.id===t[s].eleId)n.nextElementSibling.classList.add("w3-blue-grey");else{const e=document.getElementById(t[s].eleId);e&&e.nextElementSibling.classList.remove("w3-blue-grey")}}